"use strict";

const functions = require('firebase-functions');
const admin = require('firebase-admin');
const cors = require('cors')({ origin: false });

/**
 * Gateway Function
 * @req UDID, Text
 * @res ResponseJson
 */
exports.dialogflowGateway = functions
  .region('europe-west1')
  .https.onRequest((request, response) => {
    cors(request, response, async () => {
      const { SessionsClient } = require('@google-cloud/dialogflow');

      console.log(`1. Begin ${request.body}, text: ${request.body.text}, id: ${request.body.id}`);
      const sessionId = request.body.id;
      const sessionClient = new SessionsClient();

      const session = sessionClient.projectAgentSessionPath(
        'thesis-c30c3',
        sessionId
      );

      const aanv = {
        session: session,
        queryInput: {
          text: {
            text: request.body.text,
            languageCode: 'nl-NL',
          },
        },
        outputAudioConfig: {
          audioEncoding: 'OUTPUT_AUDIO_ENCODING_MP3',
          synthesizeSpeechConfig: {
            "speakingRate": 0.95,
            "pitch": -4,
            "voice": {
              "name": "nl-NL-Wavenet-D"
            }
          }
        },
      };

      console.log(`2. Sending Request: ${aanv}`)

      const responses = await sessionClient.detectIntent(aanv);
      const result = responses[0].queryResult; //type:
      const audioFile = responses[0].outputAudio; //type: buffer
      const base64data = audioFile.toString('base64'); //type: string


      console.log(`3. Response: ${result.fulfillmentText}`);
      console.log(result);
      console.log(result.messages);
      try {

        var final = {
          "responseId": result.responseId,
          "sessionId": sessionId,
          "keepAlive": true,
          "intentId": result.outputContexts[0].parameters.fields.intentId.numberValue,
          "intentName": result.intent.displayName,
          "text": result.fulfillmentText,
          "audio": base64data,
          "parameters": result.outputContexts[0].parameters.fields
        }
        console.log(`4. Intent Succes: ${result.intent.displayName}`);
      } catch (err) {
        console.log(`5. Intent fail ${err}`);
        var final = {
          "responseId": result.responseId,
          "sessionId": sessionId,
          "keepAlive": false,
          "intentId": '0000',
          "intentName": 'ERROR',
          "text": 'Error',
          "audio": '',
          "parameters": {},
        }
      }
      console.log(`6. Sending response: ${final}`);
      response.send(final);
    });
  });

